max_output: 1
doc: '

  Construct a tensor sequence containing ''inputs'' tensors.

  All tensors in ''inputs'' must have the same data type.

  '
attributes: []
inputs:
- name: inputs
  type_str: T
  description: Tensors.
  min_arity: 1
  tags:
  - variadic
outputs:
- name: output_sequence
  type_str: S
